    items: DSList(length=20, elem_type=Item),
    item_assignments: DSList(length=20, elem_type=ItemAssignment),
    positions: DSList(length=20, elem_type=Position)
):
    # Ensure each item fits within box dimensions
    for i in range(1, N_ITEMS + 1):
        assert items[i].width <= BOX_WIDTH
        assert items[i].height <= BOX_HEIGHT

        # Ensure positions are within box boundaries
        assert positions[i].x >= 0
        assert positions[i].y >= 0
        assert positions[i].x + items[i].width <= BOX_WIDTH
        assert positions[i].y + items[i].height <= BOX_HEIGHT

        # Link item assignment to position
        assert item_assignments[i].position.x == positions[i].x
        assert item_assignments[i].position.y == positions[i].y

    # Ensure no overlapping between items in same box
    for i in range(1, N_ITEMS + 1):
        for j in range(i + 1, N_ITEMS + 1):
            # Only check items in the same box
            if item_assignments[i].box_id == item_assignments[j].box_id:
                # Check for overlap in x-direction
                assert not (
                    (positions[i].x < positions[j].x + items[j].width) and
                    (positions[j].x < positions[i].x + items[i].width)
                ) or (
                    positions[i].x >= positions[j].x + items[j].width or
                    positions[j].x >= positions[i].x + items[i].width
                )

                # Check for overlap in y-direction
                assert not (
                    (positions[i].y < positions[j].y + items[j].height) and
                    (positions[j].y < positions[i].y + items[i].height)
                ) or (
                    positions[i].y >= positions[j].y + items[j].height or
                    positions[j].y >= positions[i].y + items[i].height
                )

